import React, { Component } from 'react';
import Tiffnail from 'tiffnail-and-i';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {

      let bytes = "";

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1 className="App-title">Tiffnail And I Example</h1>
        </header>
        <p className="App-intro">
          Below is an example result of passing base64 encoded string content of a TIFF format image to the Tiffnail component.
            Thus enabling the content of TIFF images to be rendered in the browser.
        </p>
          <Tiffnail bytes={bytes}/>
      </div>
    );
  }
}

export default App;
